const { jsPDF } = window.jspdf;

// #region Fuente de letra en binario
let font = '';
// #endregion

/**
 * Función para insertar encabezado en una hoja del documento
 * @param {Object<jsPDF>} doc Documento para insertar encabezado 
 */
function insertarHeader(doc) {
    doc.setFontSize(10);
    doc.text("SIMAPE v1.0", 10, 10);
    doc.setFontSize(14);
};

/**
 * Función para insertar firmas al final de la página
 * @param {Object<jsPDF>} doc Documento para insertar las firmas
 * @param {String} nombreUsuario Nombre del usuario administrador
 * @param {String} nombreSupervisor Nombre del supervisor
 */
function insertarFirmas(doc, nombreUsuario, nombreSupervisor) {
    doc.setFontSize(11);
    doc.line(20, doc.size.y - 25, (doc.size.x / 2) - 10, doc.size.y - 25);
    doc.line((doc.size.x / 2) + 10, doc.size.y - 25, doc.size.x - 20, doc.size.y - 25);
    doc.text('Responsable', 20, doc.size.y - 20);
    doc.text(`${nombreUsuario}`, 20, doc.size.y - 15);
    doc.text('Supervisor', (doc.size.x / 2) + 10, doc.size.y - 20);
    doc.text(`${nombreSupervisor}`, (doc.size.x / 2) + 10, doc.size.y - 15);
    doc.setFontSize(11);
};

const movSup = {
    /**
     * @type String
     */
    nss:'',
    /**
     * @type String
     */
    nombre:''
}

/**
 * Función para generar un reporte en PDF de las supervisiones
 * @param {Number} folio Folio del movimiento
 * @param {String} nombreUsuario Nombre del usuario administrador
 * @param {String} nombreSupervisor Nombre del supervisor
 * @param {Date} fecha Fecha de la supervisión
 * @param {Array<movSup>} movimientos Lista de movimientos que contienen el nss y el nombre de cada expediente
 */
export function generarReportePDF(folio, nombreUsuario, nombreSupervisor, fecha, movimientos) {
    // Definir el archivo PDF en tamaño carta
    const doc = new jsPDF({
        format: 'letter'
    });

    // Inicializar variables para trabajar con el documento
    doc.size = {x: 215, y:280};
    doc.cursor = {x:0, y:0}

    // Cambiar la fuente del documento
    doc.addFileToVFS("Montserrat-Regular.ttf", font);
    doc.addFont("Montserrat-Regular.ttf", "Montserrat-Regular", "normal");
    doc.setFont('Montserrat-Regular', 'normal');

    // Insertar el encabezado
    insertarHeader(doc);

    // Insertar el título
    doc.setFontSize(20);
    doc.text("SUPERVISIÓN DE EXPEDIENTES", 48, 20);
    doc.setFontSize(14);

    // Insertar los datos
    doc.text(`Folio: ${folio}`, 10, 30);
    doc.text(`Fecha de impresión: ${fecha.toLocaleString()}`, 10, 40);
    doc.line(10, 50, doc.size.x - 10, 50);

    // Imprimir todos los números de expediente
    doc.text(`Expedientes a extraer`, 10, 60);
    doc.setFontSize(12);
    doc.cursor.y = 60;

    for (let i=0; i<movimientos.length; i++) {
        doc.cursor.y += 10;

        if (doc.cursor.y > doc.size.y - 30) {
            doc.addPage();
            insertarHeader(doc);
            doc.cursor.y = 20;
        }
        doc.text(`${movimientos[i].nss}`, 10, doc.cursor.y);
        doc.text(`${movimientos[i].nombre}`, 100, doc.cursor.y);
    }

    // Insertar Firmas
    insertarFirmas(doc, nombreUsuario, nombreSupervisor);

    // Guardar el documento
    doc.save(`Informe_SIMAPE.pdf`);
}